import UrlRoute from "../helpers/UrlRouter.js";
import { api } from "./api";

const getAllAdmin = async () => {
  const response = await api.get(UrlRoute.getAllAdmin);
  return response.data;
};

const toggleAdminStatus = async (values) => {
  const response = await api.put(UrlRoute.toggleAdminStatus, values);
  return response.data;
};

const addNewAdmin = async (values) => {
  const response = await api.post(UrlRoute.addNewAdmin, values);
  return response.data;
};

const deleteAdmin = async (values) => {
  const response = await api.delete(`${UrlRoute.addNewAdmin}/${values}`);
  // console.log(""`${UrlRoute.addNewAdmin}/${values}`);
  return response.data;
};

const adminCustomerLogin = async (values) => {
  const response = await api.post(
    `${UrlRoute.adminCustomerLogin}/${values}/login`
  );
  return response.data;
};

const adminService = {
  getAllAdmin,
  toggleAdminStatus,
  addNewAdmin,
  deleteAdmin,
  adminCustomerLogin,
};

export default adminService;
